package org.example.algo.day4_hashtable;

import java.util.HashMap;
import java.util.Map;
import java.util.Objects;

/**
 * @author yelihu
 */
public class IsAnagram {
    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        Map<Character, Integer> countMapS = new HashMap<>();
        for (char c : s.toCharArray()) {
            Integer count = countMapS.getOrDefault(c, 0);
            count++;
            countMapS.put(c, count);
        }

        Map<Character, Integer> countMapT = new HashMap<>();
        for (char c : t.toCharArray()) {
            Integer count = countMapT.getOrDefault(c, 0);
            count++;
            countMapT.put(c, count);
        }

        for (Map.Entry<Character, Integer> entry : countMapS.entrySet()) {
            Character key = entry.getKey();
            if (countMapT.get(key) == null) {
                return false;
            }
            //下面不能用!=，必须要用equals
            if (!Objects.equals(countMapT.get(key), countMapS.get(key))) {
                return false;
            }
        }
        return true;
    }

    public boolean isAnagramBetter(String s, String t) {
        int[] rec = new int[26];
        for (int i = 0; i < s.length(); i++) {
            rec[s.charAt(i) - 'a']++;
        }
        for (int i = 0; i < t.length(); i++) {
            rec[t.charAt(i) - 'a']--;
        }
        for (int j : rec) {
            if (j != 0) {
                return false;
            }
        }
        return true;
    }


    public static void main(String[] args) {
        IsAnagram isAnagram = new IsAnagram();
        System.out.println(isAnagram.isAnagram(
                "",
                //
                ""));
        System.out.println(isAnagram.isAnagram("rat", "car"));
        System.out.println(isAnagram.isAnagram("a", "ab"));
    }
}
